column2:
@PetrovichKolya @ethereansinfo @sassal0x I think it's quite funny to get ratio'd.

He accused me of authoritarianism/subjugation when I defended his freedom to speak. That doesn't even make sense.

I thought better of entering into a dictionary quoting debate though. We all have Google right?

@jdcc_inc @ethereansinfo @sassal0x Exactly.

Nothing has been censored.

The comments are filled with the views of both sides. In fact today seems to be a victory for free speech advocates.

@ethereansinfo @sassal0x Today was a victory for freedom.

The freedom for me to challenge his opinion. The freedom for you to critisise their decision to terminate his contract.

The freedom for True Names Ltd to make a decision in the best interests of their business, taking into account both views.

@_axtina @nicksdjohnson @ensdomains Most of the stuff he was saying could not be described as a religious stance. In many countries it would be classified as hate speech and a crime.

This isn't about religion, he just tried to play that card to save his skin.

I know Catholics and they don't say those things.

@nicksdjohnson @BrantlyMillegan @ensdomains Isn't this just textbook whataboutism? 

He was called out for publicly persecuting groups of people, but now claims to be the one being persecuted.

No one even mentioned his religion as being an issue here, only his words.
